import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import "./simpleSlider.css"; 

function Arrow(props) {
  const { className, style, onClick } = props;

  const handleClick = () => {
    if (onClick) {
      onClick();
    }
  };

  return (
    <div
      className={className}
      style={{ ...style, display: "block" }}
      onClick={handleClick} 
    />
  );
}



function SimpleSlider() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    nextArrow: <Arrow/>,
    prevArrow: <Arrow/>
  };
  return (
    <div className="slider-container"> {/* Apply CSS styles here */}
      <Slider {...settings}>
        <div>
          <div className="box">
            <h3>1</h3>
          </div>
        </div>
        <div>
          <div className="box">
            <h3>2</h3>
          </div>
        </div>
        <div>
          <div className="box">
            <h3>3</h3>
          </div>
        </div>
        <div>
          <div className="box">
            <h3>4</h3>
          </div>
        </div>
        <div>
          <div className="box">
            <h3>5</h3>
          </div>
        </div>
        <div>
          <div className="box">
            <h3>6</h3>
          </div>
        </div>
      </Slider>
    </div>
  );
}

export default SimpleSlider;
